[[package]]
category = "main"
description = "Radically simple IT automation"
name = "ansible"
optional = false
python-versions = ">=2.7,!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,!=3.4.*"
version = "2.9.7"

[[package]]
category = "dev"
description = "Checks playbooks for practices and behaviour that could potentially be improved"
name = "ansible-lint"
optional = false
python-versions = "!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,!=3.4.*,>=2.7"
version = "4.2.0"

[package.dependencies]
ansible = ">=2.7"
pyyaml = "*"
six = "*"

[[package.dependencies."ruamel.yaml"]]
python = "<3.7"
version = ">=0.15.34,<1"

[[package.dependencies."ruamel.yaml"]]
python = ">=3.7"
version = ">=0.15.37,<1"

[[package]]
category = "dev"
description = "YAML parser and emitter for Python"
name = "pyyaml"
optional = false
python-versions = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"
version = "5.3"

[[package]]
category = "dev"
description = "ruamel.yaml is a YAML parser/emitter that supports roundtrip preservation of comments, seq/map flow style, and map key order"
marker = "python_version < \"3.7\" or python_version >= \"3.7\""
name = "ruamel.yaml"
optional = false
python-versions = "*"
version = "0.16.10"

[package.dependencies]
[package.dependencies."ruamel.yaml.clib"]
python = "<3.9"
version = ">=0.1.2"

[package.extras]
docs = ["ryd"]
jinja2 = ["ruamel.yaml.jinja2 (>=0.2)"]

[[package]]
category = "dev"
description = "C version of reader, parser and emitter for ruamel.yaml derived from libyaml"
marker = "platform_python_implementation == \"CPython\" and python_version < \"3.7\" or platform_python_implementation == \"CPython\" and python_version < \"3.9\" and python_version >= \"3.7\""
name = "ruamel.yaml.clib"
optional = false
python-versions = "*"
version = "0.2.0"

[[package]]
category = "dev"
description = "Python 2 and 3 compatibility utilities"
name = "six"
optional = false
python-versions = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*"
version = "1.14.0"

